<?php

namespace Appleton\Taxes\Seeds;

use Appleton\Taxes\Countries\US\Alabama\AttallaOccupational;
use DB;
use Illuminate\Database\Seeder;

class AttallaSeeder extends Seeder
{
    public function run()
    {
        $id = DB::table('governmental_unit_areas')->insertGetId([
            'name' => 'Attalla, AL',
            'area' => '',
        ]);

        DB::table('tax_areas')->insert([
            'name' => 'Attalla Occupational Tax',
            'tax' => AttallaOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
